func waysToSplit(nums []int) int {
	split := 0
	for i := 1; i < len(nums)-1; i++ {
		for j := i + 1; j < len(nums); j++ {
			sumL := 0
			for _, val := range nums[0:i] {
				sumL += val
			}
			sumM := 0
			for _, val := range nums[i:j] {
				sumM += val
			}
			sumR := 0
			for _, val := range nums[j:] {
				sumR += val
			}
			if sumL <= sumM && sumM <= sumR {
				split++
			}
		}
	}
	return split
}
